import React from "react";
import { NavLink } from "react-router-dom";

function Landing() {
  return (
    <>
      <NavLink to={"/"}>Landing</NavLink>

      <NavLink to={"/FAQ"}>FAQ</NavLink>
    </>
  );
}

export default Landing;
